import XCTest

@testable import WhiteBoardCodingChallenges

class BeastTests: XCTestCase {
    
    // MARK: Test
    
    func test_invalidInput() {
        
        let decentNumber = Beast.decentNumber(range: 1)
        
        XCTAssertEqual(decentNumber, "-1")
    }
    
    func test_allFives() {
        
        let decentNumber = Beast.decentNumber(range: 3)
        
        XCTAssertEqual(decentNumber, "555")
    }
    
    func test_allThrees() {
        
        let decentNumber = Beast.decentNumber(range: 5)
        
        XCTAssertEqual(decentNumber, "33333")
    }
    
    func test_57634() {
        
        let decentNumber = Beast.decentNumber(range: 57634)
        
        XCTAssertEqual(decentNumber, "")
    }
    
    func test_55140() {
        
        let decentNumber = Beast.decentNumber(range: 55140)
        
        XCTAssertEqual(decentNumber, "")
    }
    
    func test_21965() {
        
        let decentNumber = Beast.decentNumber(range: 21965)
        
        XCTAssertEqual(decentNumber, "")
    }
    
    func test_12002() {
        
        let decentNumber = Beast.decentNumber(range: 12002)
        
        XCTAssertEqual(decentNumber, "")
    }
    
    func test_2194() {
        
        let decentNumber = Beast.decentNumber(range: 2194)
        
        XCTAssertEqual(decentNumber, "")
    }
    
    func test_5() {
        
        let decentNumber = Beast.decentNumber(range: 5)
        
        XCTAssertEqual(decentNumber, "33333")
    }
    
}
